import React from "react";
const Login = () => {
  return (
    <div className="container">
      <div className="row mt-5">
        <div className="col-6 border border-4 mt-5">Full Image</div>
        <div className="col-4 border border-4 mt-3">Actual Form</div>
      </div>
    </div>
  );
};
export default Login;
